Defendant Jessica M Wapp in court with attorney J Anthony Rosario.   District Attorney's Office Law Intern appeared for the State of Wisconsin.  State makes recommendations.  Attorney Rosario makes statements. Defendants employer makes statements. Defendant makes statements. 

The Court Orders the Following:  Count #16
Imposed and Stayed Sentence of:
4 Years Imprisonment (Credit - 1 day)
2 Years of Initial Confinement
2 Years of Extended Supervision

Term of Probation: 3 Years
Conditions of Probation:
Early release after 2 years if deemed appropriate by agent
AODA Assessment and follow through with any treatment recommended;
Absolute Sobriety; Random U.A.s;
No Use or Possession of alcohol or illegal drugs;
No Use or Possession of prescription drugs without a valid prescription;
Any valid prescription drugs must be taken in the manner in which they are prescribed;
Inform agent of all prescriptions;
Follow through with any treatment and/or counseling recommended by Agent;
Take a Cognitive Thinking Course;
Defendant to have no Contact with any co-defendant unless approved by agent.
Provide DNA sample if not yet provided  and pay surcharge
Use same pharmacy for all prescriptions;
Advise treatment provider of charges and rules of probation;
Condition Time: 60 days Huber with NON WORKING HOURS WITH STANDARD RELEASE CONDITIONS STAYED to be used at the Agents discretion
COSTS:  $268.00 to be paid as a condition of probation
DNA Surcharge: $250.00 to be paid as a condition of probation
DNA Sample ordered and to be provided immediately if in custody or within (3) business days at the Waukesha County Sheriff Department. 
Defendant is not eligible for the Challenge Incarceration Program
Defendant is eligible for the Substance Abuse Program
Felony warnings, immigration warnings, voting rights and firearms warnings given.
